import Link from 'next/link';

import SideNav from '../components/side-nav.component';

const LandingPage = () => {
  console.log('in index');

  return (
    <div>
      <SideNav />
      <h1>HOME PAGE</h1>
      <p>Buy glasses plz</p>
      <Link href='/shopInsta'>
        <a>SHOP INSTA</a>
      </Link>
      <Link href='/contact'>
        <a>CONTACT US</a>
      </Link>
    </div>
  );
};

export default LandingPage;
